import './App.css';
import Navbar from "./NavBar";
import HomePage from './HomePage';
import { Route, Routes, BrowserRouter } from 'react-router-dom';
import Projects from './Projects';
import AboutMe from './AboutMe';
import MazeGame from './MazeGame';
import MySkills from './MySkills'
import DevOps from './DevOps';

import moon from './images/space.jpg'
import mountains from './images/neatbg.png'
import dirt from './images/dirt.jpg'
import cat from './videos/cat.gif'
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import { useSpring, animated } from '@react-spring/web';

function App() {

  const textSpring = useSpring({
    opacity: 1,
    from: { opacity: 0 },
  });

  return (
    <div>
      <Parallax pages={4}>
        <ParallaxLayer
          offset={0}
          speed={1}
          factor={1}
          style={{
            backgroundImage: `url(${moon})`,
            backgroundSize: 'cover'
          }}
        ></ParallaxLayer>

        <ParallaxLayer
          offset={1}
          speed={1}
          factor={1}
          style={{
            backgroundImage: `url(${mountains})`,
            backgroundSize: 'cover'
          }}
        ></ParallaxLayer>

        <ParallaxLayer
          offset={0.2}
          speed={0.05}
        >
          <h2>Hi, I'm Nemanja!</h2>
        </ParallaxLayer>

        <ParallaxLayer
          offset={1.2}
          speed={0.05}
        >
          <h2>And this is my website!</h2>
        </ParallaxLayer>

        <ParallaxLayer
          offset={2}
          speed={1}
          factor={1}
        >
          <Projects/>
        </ParallaxLayer>
      </Parallax>
    </div>
  );
}

export default App;
